// Function 17: Plot Circle
void plot_circle(Ball ball){
    int x = ball.xLocation;
    int y = ball.yLocation;
    int r = ball.radius;
    short int color = ball.color;
    
    int count = 0;
    int d = 1-r;
    
    while(r > count){
        draw_line(-count+x, r+y, count+x, r+y, color);
        draw_line(-r+x, count+y, r+x, count+y, color);
        draw_line(-count+x, -r+y, count+x, -r+y, color);
        draw_line(-r+x, -count+y, r+x, -count+y, color);
        
        if(d < 0){
            d = d + 2*count + 3;
        }else{
            d = d + 2*(count - r) + 5;
            r--;
        }
        count++;
    }
}

// Function 18: Plot lines
void draw_line(int startX, int startY, int endX, int endY, short int color){
    bool isSteep = (ABS(endY - startY) > ABS(endX - startX));
    
    if(isSteep){
        swap(&startX, &startY);
        swap(&endX, &endY);
    }
    
    if(startX > endX){
        swap(&startX, &endX);
        swap(&startY, &endY);
    }
    
    // Bresenham's Algorithm
    int deltaX = endX - startX;
    int deltaY = ABS(endY - startY);
    int error = -(deltaX / 2);
    int stepY;
    
    // y step
    if(startY < endY){
        stepY = 1;
    }else if(startY > endY){
        stepY = -1;
    }else{
        stepY = 0;
    }
    
    // for loop
    int y = startY;

    for(int x = startX; x < endX; ++x){
        if(isSteep){
            plot_pixel(y, x, color);
        }else{
            plot_pixel(x, y, color);
        }
        
        error = error + deltaY;
        
        if(error >= 0){
            y = y + stepY;
            error = error - deltaX;
        }
    }
}

